import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={require('./0.jpeg')} className="App-logo" alt="logo" />
        <p>
          Hello, my Name is Tarcisius Daniel Hartanto
        </p>
        <p>
          Here is the link to my bio. Hope you will enjoy it...
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
